description:
Dariusburst is an offbeat sci-fi shooter set in outer space with aquatic-themed (typically fish-shaped) robotic enemies. In keeping with tradition, the game also features branching paths instead of the linear progression found in most video games. There are a total of 11 zones in the game, with 5 stages per run.

This is a PSP emulated version.

The emulator is Xbox360 controller compatible &amp; pre-configured.

System Requirements:

Core 2 duo 2.4GHz or higher.
nVidia GeForce GT 620 / ATI Radeon HD 5 series or higher.
3 Gig of ram or more.
Windows XP / Vista / 7 / 8 32 or 64bit OS.

